// Global
const HOME = "/";
const JOIN = "/join";
const LOGIN = "/login";
const LOGOUT = "/logout";
const SEARCH = "/search";

// Users
const USERS = "/users";
const USER_DETAIL = "/:id";
const EDIT_PROFILE = "/edit-profile";
const CHANGE_PASSWORD = "/change-password";
const ME = "/me";

// data
const DATAS = "/data";
const DATA_DETAIL = "/:id/detail";

// Social Login
const GOOGLE = "/auth/google";
const GOOGLE_CALLBACK = "/auth/google/callback";

// API
const API = "/api";
const WEATHER = "/weather";
const KAKAO_LOGIN = "/:id/kakao";

const routes = {
    //Global
    home: HOME,
    join: JOIN,
    login: LOGIN,
    logout: LOGOUT,
    search: SEARCH,

    //Users
    users: USERS,
    userDetail: id => {
        if (id) {
          return `/users/${id}`;
        } else {
          return USER_DETAIL;
        }
    },
    editProfile: EDIT_PROFILE,
    changePassword: CHANGE_PASSWORD,
    me: ME,

    //Datas
    data: DATAS,
    dataDetail: id => {
        if (id) {
          return `/data/${id}/detail`;
        } else {
          return DATA_DETAIL;
        }
    },

    // Social Login
    google: GOOGLE,
    googleCallback: GOOGLE_CALLBACK,

    // API
    api: API,
    weather: WEATHER,
    kakaoLogin: KAKAO_LOGIN
};

export default routes;

