        return res.json({ // íŒŒì´ì¬ íŒŒì¼ë¡œë¶€í„° ì²˜ë¦¬ëœ ë°ì´í„°ë¥¼ í´ë¼ì´ì–¸íŠ¸ë¡œ ì „ì†¡
            success: true,
            data
        })
