const DATAS = "/data";
const DATA_USER = "/:id";
const DETAIL_DATA = "/product/:id"

// API
const API = "/api";
const WEATHER = "/weather";

const routes = {
    //Global
    home: HOME,
    join: JOIN,
    login: LOGIN,
    auth: AUTH,
    logout: LOGOUT,
