        if (id) {
          return `/data/${id}`;
        } else {
          return DATA_USER;
        }
    },
    detailData: id => {
      if (id) {
        return `/data/product/${id}`;
      } else {
        return DETAIL_DATA;
      }
    },
    // API
    api: API,
    weather: WEATHER
};

export default routes;

